function showNextPrev(e,t){idPageSelected="page-selected"+e,idItemLIst="item-list "+e;var n=document.getElementsByClassName(idItemLIst),m=n.length,d=document.getElementById(idPageSelected).innerHTML;if(t)var l=Number(d)>=m?1:Number(d)+1;else var l=Number(d)<=1?m:Number(d)-1;d.innerText||d.textContent;document.getElementById(idPageSelected).innerHTML=l+" ";var n=document.getElementsByClassName(idItemLIst);for(i in n)try{n[i].style.display="none"}catch(e){}return document.getElementById("item-list"+e+l).style.display="block",!1}